import React from "react";

function Nav(): JSX.Element {
  return (
    <nav>
      <h1>Dave's Decor</h1>
      <h2>Welcome to Dave's Decor</h2>
      <p>Refined Painting. Elevated Living</p>
      <ul>
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
        <li>
          <a href="#">Contact</a>
        </li>
      </ul>
    </nav>
  );
}

export default Nav;
